import React from 'react';
import './App.css';
import Player from './Player.js'

export default function PlayerList({ Players, HandleOrderChange, HandleNextTurn}){
    return(
        <div>
            {Players.map(player => {
                return <Player key={player.Position} player={player} HandleNextTurn={HandleNextTurn}/>
            })}
            <button onClick={HandleOrderChange}>Change Order</button>
        </div>
    )
}
